class Solution {
    func canMakeSubsequence(_ str1: String, _ str2: String) -> Bool {
        var indexes = Array(repeating: -1, count: 26) // Track last seen indexes for each letter in str1
        let s1 = Array(str1)
        let s2 = Array(str2)

        // Preprocess str1 to find the last occurrence of each character
        for (i, char) in s1.enumerated().reversed() {
            indexes[Int(char.asciiValue! - Character("a").asciiValue!)] = i
        }

        var prevIndex = -1 // Track the last matched character's index in str1
        for char in s2 {
            let charIndex = Int(char.asciiValue! - Character("a").asciiValue!)
            if indexes[charIndex] == -1 {
                // If the current character in str2 was never found in str1, return false
                return false
            }
            // Check if we can cyclically move to the next character given the last character's index
            let nextCharIndex = (charIndex + 1) % 26
            let possibleIndex = indexes[nextCharIndex]
            if possibleIndex <= prevIndex {
                // If the next character is not found after the previous matching character, return false
                return false
            }
            prevIndex = possibleIndex
        }
        return true
    }
}
